    true,nt"url": null,nt"notes": "<p>HealthIT Dashboard Certified Electronic
    Health Record (CEHRT) Vendors and Products<br />nThe Medicare and Medicaid Electronic
    Health Record (EHR) Incentive Programs provide incentives to eligible ambulatory
    and inpatient providers to adopt electronic health records, and the ONC Health IT
    Regional Extension Centers (REC) Program provides assistance to providers to adopt
    and meaningfully use EHRs. These data provide the counts of health care providers
    that have reported a vendors product through participation in either the CMS EHR
    Incentive Programs or ONC REC Program. The data are provided beginning in April,
    2011. If you have any questions or concerns about this documentation, please contact
    ONC.RequestAThhs.gov. You can access the data in multiple formats on the data page
    or below. This is an ongoing project managed by the Office of the National Coordinator
    for Health Information Technology, an agency of the Department of Health and Human
    Services.</p>n",nt"license_title": "Other License Specified",nt"extras":
